import React from "react";
import {
  Wrapper,
  Nav,
  NavLogo,
  NavList,
  NavListItem,
  SecondaryBtn,
  PrimaryBtn,
  NavActions,
  Hamburger,
  HamburgerBox,
  HamburgerInner,
} from "./navigation.styles.js";

function Navigation() {
  const handleClick = () => {
    const hamburger = document.querySelector(".hamburger__inner");
    const nav = document.querySelector(".nav");
    hamburger.classList.toggle("hamburger--active");
    nav.classList.toggle("active");

    console.log(hamburger);
  };

  return (
    <>
      <Hamburger className='hamburger' onClick={() => handleClick()}>
        <HamburgerBox className='hamburger__box'>
          <HamburgerInner className='hamburger__inner'></HamburgerInner>
        </HamburgerBox>
      </Hamburger>
      <Wrapper className='nav'>
        <Nav>
          <NavLogo>
            <img src='../../public/logo2.png' alt='logo' />
          </NavLogo>
          <NavList>
            <NavListItem>
              <a href='#'>Home</a>
            </NavListItem>
            <NavListItem>
              <a href='#'>About</a>
            </NavListItem>
            <NavListItem>
              <a href='#'>Courses</a>
            </NavListItem>
            <NavListItem>
              <a href='#'>Blog</a>
            </NavListItem>
            <NavListItem>
              <a href='#'>Contact</a>
            </NavListItem>
          </NavList>
          <NavActions></NavActions>
        </Nav>
      </Wrapper>
    </>
  );
}

export default Navigation;
